import React from 'react';
import logo from './logo.svg';
import './App.css';



function header(){
  return(
    <head>
      <title>Fitch: the student collaborating platform </title>
    </head>
  );
}


function App() {
  return (
    <div className="App">
    {header}

    </div>
  );
}

export default App;
